import React, { useState } from 'react';
import { 
  Building2, 
  CreditCard, 
  MessageSquare, 
  Shield, 
  Plus,
  X,
  Camera,
  Upload,
  HelpCircle,
  Settings,
  Banknote,
  Smartphone,
  Mic,
  Lock
} from 'lucide-react';
import { 
  Card, 
  CardContent, 
  CardHeader, 
  CardTitle,
  Tabs,
  TabsContent,
  TabsList,
  TabsTrigger,
  Button,
  Input,
  Label,
  Select,
  SelectContent,
  SelectItem,
  SelectTrigger,
  SelectValue,
  Textarea,
  Badge,
  Modal,
  ModalContent,
  ModalHeader,
  ModalBody,
  ModalFooter,
  useDisclosure
} from 'flowbite-react';

interface BankAccount {
  id: number;
  bankName: string;
  accountNumber: string;
  sortCode: string;
  accountHolder: string;
  openBankingEnabled: boolean;
}

interface CreditCard {
  id: number;
  cardNumber: string;
  expiryDate: string;
  cvv: string;
  cardholderName: string;
  billingAddress: string;
  cardType: string;
  provider: string;
}

interface CommunicationChannel {
  id: number;
  type: 'email' | 'sms' | 'voice' | 'secure';
  enabled: boolean;
  config: any;
}

function App() {
  const [activeTab, setActiveTab] = useState('bankaccounts');
  const [bankAccounts, setBankAccounts] = useState<BankAccount[]>([
    {
      id: 1,
      bankName: '',
      accountNumber: '',
      sortCode: '',
      accountHolder: '',
      openBankingEnabled: false
    }
  ]);
  const [creditCards, setCreditCards] = useState<CreditCard[]>([
    {
      id: 1,
      cardNumber: '',
      expiryDate: '',
      cvv: '',
      cardholderName: '',
      billingAddress: '',
      cardType: 'visa',
      provider: 'visa'
    }
  ]);
  const [communicationChannels, setCommunicationChannels] = useState<CommunicationChannel[]>([
    { id: 1, type: 'email', enabled: true, config: {} },
    { id: 2, type: 'sms', enabled: false, config: {} },
    { id: 3, type: 'voice', enabled: false, config: {} },
    { id: 4, type: 'secure', enabled: false, config: {} }
  ]);

  const { isOpen: isUploadOpen, onOpen: onUploadOpen, onClose: onUploadClose } = useDisclosure();
  const { isOpen: isHelpOpen, onOpen: onHelpOpen, onClose: onHelpClose } = useDisclosure();

  const addBankAccount = () => {
    const newAccount: BankAccount = {
      id: bankAccounts.length + 1,
      bankName: '',
      accountNumber: '',
      sortCode: '',
      accountHolder: '',
      openBankingEnabled: false
    };
    setBankAccounts([...bankAccounts, newAccount]);
  };

  const addCreditCard = () => {
    const newCard: CreditCard = {
      id: creditCards.length + 1,
      cardNumber: '',
      expiryDate: '',
      cvv: '',
      cardholderName: '',
      billingAddress: '',
      cardType: 'visa',
      provider: 'visa'
    };
    setCreditCards([...creditCards, newCard]);
  };

  const removeBankAccount = (id: number) => {
    setBankAccounts(bankAccounts.filter(account => account.id !== id));
  };

  const removeCreditCard = (id: number) => {
    setCreditCards(creditCards.filter(card => card.id !== id));
  };

  const updateBankAccount = (id: number, field: keyof BankAccount, value: any) => {
    setBankAccounts(bankAccounts.map(account => 
      account.id === id ? { ...account, [field]: value } : account
    ));
  };

  const updateCreditCard = (id: number, field: keyof CreditCard, value: any) => {
    setCreditCards(creditCards.map(card => 
      card.id === id ? { ...card, [field]: value } : card
    ));
  };

  const getTabIcon = (tab: string) => {
    switch (tab) {
      case 'bankaccounts': return <Building2 className="w-4 h-4" />;
      case 'creditcards': return <CreditCard className="w-4 h-4" />;
      case 'communicationchannels': return <MessageSquare className="w-4 h-4" />;
      case 'security': return <Shield className="w-4 h-4" />;
      default: return <Settings className="w-4 h-4" />;
    }
  };

  const getStatusBadge = (isRequired: boolean, hasValue: boolean) => {
    if (isRequired && !hasValue) {
      return <Badge color="failure" className="status-badge status-missing">Missing</Badge>;
    } else if (isRequired) {
      return <Badge color="success" className="status-badge status-required">REQ</Badge>;
    } else {
      return <Badge color="warning" className="status-badge status-optional">Optional</Badge>;
    }
  };

  return (
    <div className="min-h-screen bg-gray-900 text-white">
      {/* Header */}
      <div className="border-b border-gray-700 bg-gray-800">
        <div className="flex items-center justify-between p-4">
          <div>
            <h1 className="text-xl font-semibold">Settings Configuration</h1>
            <p className="text-gray-400 text-sm">Manage your application settings</p>
          </div>
          <div className="flex gap-2">
            <Button color="gray" onClick={onHelpOpen}>
              <HelpCircle className="w-4 h-4 mr-2" />
              Get Help
            </Button>
            <Button color="gray" onClick={onUploadOpen}>
              <Upload className="w-4 h-4 mr-2" />
              Upload Documents
            </Button>
          </div>
        </div>
      </div>

      {/* Main Content */}
      <div className="flex h-[calc(100vh-80px)]">
        {/* Sidebar */}
        <div className="w-80 bg-gray-800 border-r border-gray-700">
          <Tabs value={activeTab} onValueChange={setActiveTab} className="h-full">
            <TabsList className="w-full bg-gray-800 border-b border-gray-700 rounded-none">
              <TabsTrigger 
                value="bankaccounts" 
                className="flex items-center gap-2 data-[state=active]:bg-green-500 data-[state=active]:text-black"
              >
                <Building2 className="w-4 h-4" />
                Bank Accounts
                <Badge color="gray" className="ml-auto">{bankAccounts.length}</Badge>
              </TabsTrigger>
              <TabsTrigger 
                value="creditcards"
                className="flex items-center gap-2 data-[state=active]:bg-green-500 data-[state=active]:text-black"
              >
                <CreditCard className="w-4 h-4" />
                Credit Cards
                <Badge color="gray" className="ml-auto">{creditCards.length}</Badge>
              </TabsTrigger>
              <TabsTrigger 
                value="communicationchannels"
                className="flex items-center gap-2 data-[state=active]:bg-green-500 data-[state=active]:text-black"
              >
                <MessageSquare className="w-4 h-4" />
                Communication
                <Badge color="gray" className="ml-auto">{communicationChannels.length}</Badge>
              </TabsTrigger>
              <TabsTrigger 
                value="security"
                className="flex items-center gap-2 data-[state=active]:bg-green-500 data-[state=active]:text-black"
              >
                <Shield className="w-4 h-4" />
                Security
                <Badge color="gray" className="ml-auto">3</Badge>
              </TabsTrigger>
            </TabsList>

            {/* Bank Accounts Tab */}
            <TabsContent value="bankaccounts" className="p-6">
              <div className="space-y-4">
                <div className="flex items-center justify-between">
                  <h2 className="text-lg font-semibold">Bank Accounts</h2>
                  <Button size="sm" onClick={addBankAccount}>
                    <Plus className="w-4 h-4 mr-2" />
                    Add Bank
                  </Button>
                </div>

                {bankAccounts.map((account, index) => (
                  <Card key={account.id} className="bg-gray-700 border-gray-600">
                    <CardHeader className="pb-3">
                      <div className="flex items-center justify-between">
                        <CardTitle className="text-sm">Bank Account {index + 1}</CardTitle>
                        {bankAccounts.length > 1 && (
                          <Button 
                            size="sm" 
                            color="failure" 
                            onClick={() => removeBankAccount(account.id)}
                          >
                            <X className="w-4 h-4" />
                          </Button>
                        )}
                      </div>
                    </CardHeader>
                    <CardContent className="space-y-4">
                      <div>
                        <Label className="flex items-center justify-between">
                          Bank Name
                          {getStatusBadge(true, !!account.bankName)}
                        </Label>
                        <Select 
                          value={account.bankName} 
                          onValueChange={(value) => updateBankAccount(account.id, 'bankName', value)}
                        >
                          <SelectTrigger className="bg-gray-600 border-gray-500 text-white">
                            <SelectValue placeholder="Select Bank" />
                          </SelectTrigger>
                          <SelectContent className="bg-gray-700 border-gray-600">
                            <SelectItem value="barclays">Barclays</SelectItem>
                            <SelectItem value="hsbc">HSBC</SelectItem>
                            <SelectItem value="lloyds">Lloyds Bank</SelectItem>
                            <SelectItem value="natwest">NatWest</SelectItem>
                            <SelectItem value="santander">Santander</SelectItem>
                          </SelectContent>
                        </Select>
                      </div>

                      <div>
                        <Label className="flex items-center justify-between">
                          Account Number
                          {getStatusBadge(true, !!account.accountNumber)}
                        </Label>
                        <Input
                          value={account.accountNumber}
                          onChange={(e) => updateBankAccount(account.id, 'accountNumber', e.target.value)}
                          placeholder="12345678"
                          className="bg-gray-600 border-gray-500 text-white"
                        />
                      </div>

                      <div>
                        <Label className="flex items-center justify-between">
                          Sort Code
                          {getStatusBadge(true, !!account.sortCode)}
                        </Label>
                        <Input
                          value={account.sortCode}
                          onChange={(e) => updateBankAccount(account.id, 'sortCode', e.target.value)}
                          placeholder="12-34-56"
                          className="bg-gray-600 border-gray-500 text-white"
                        />
                      </div>

                      <div>
                        <Label className="flex items-center justify-between">
                          Account Holder
                          {getStatusBadge(true, !!account.accountHolder)}
                        </Label>
                        <Input
                          value={account.accountHolder}
                          onChange={(e) => updateBankAccount(account.id, 'accountHolder', e.target.value)}
                          placeholder="John Doe"
                          className="bg-gray-600 border-gray-500 text-white"
                        />
                      </div>

                      <div>
                        <Label className="flex items-center justify-between">
                          Open Banking
                          {getStatusBadge(false, true)}
                        </Label>
                        <Select 
                          value={account.openBankingEnabled ? 'yes' : 'no'} 
                          onValueChange={(value) => updateBankAccount(account.id, 'openBankingEnabled', value === 'yes')}
                        >
                          <SelectTrigger className="bg-gray-600 border-gray-500 text-white">
                            <SelectValue />
                          </SelectTrigger>
                          <SelectContent className="bg-gray-700 border-gray-600">
                            <SelectItem value="yes">Yes</SelectItem>
                            <SelectItem value="no">No</SelectItem>
                          </SelectContent>
                        </Select>
                      </div>
                    </CardContent>
                  </Card>
                ))}
              </div>
            </TabsContent>

            {/* Credit Cards Tab */}
            <TabsContent value="creditcards" className="p-6">
              <div className="space-y-4">
                <div className="flex items-center justify-between">
                  <h2 className="text-lg font-semibold">Credit Cards</h2>
                  <Button size="sm" onClick={addCreditCard}>
                    <Plus className="w-4 h-4 mr-2" />
                    Add Card
                  </Button>
                </div>

                {creditCards.map((card, index) => (
                  <Card key={card.id} className="bg-gray-700 border-gray-600">
                    <CardHeader className="pb-3">
                      <div className="flex items-center justify-between">
                        <CardTitle className="text-sm">Credit Card {index + 1}</CardTitle>
                        <div className="flex gap-2">
                          <Button size="sm" color="gray">
                            <Camera className="w-4 h-4" />
                          </Button>
                          {creditCards.length > 1 && (
                            <Button 
                              size="sm" 
                              color="failure" 
                              onClick={() => removeCreditCard(card.id)}
                            >
                              <X className="w-4 h-4" />
                            </Button>
                          )}
                        </div>
                      </div>
                    </CardHeader>
                    <CardContent className="space-y-4">
                      <div>
                        <Label className="flex items-center justify-between">
                          Card Number
                          {getStatusBadge(true, !!card.cardNumber)}
                        </Label>
                        <Input
                          value={card.cardNumber}
                          onChange={(e) => updateCreditCard(card.id, 'cardNumber', e.target.value)}
                          placeholder="1234 5678 9012 3456"
                          className="bg-gray-600 border-gray-500 text-white"
                        />
                      </div>

                      <div className="grid grid-cols-2 gap-4">
                        <div>
                          <Label className="flex items-center justify-between">
                            Expiry Date
                            {getStatusBadge(true, !!card.expiryDate)}
                          </Label>
                          <Input
                            value={card.expiryDate}
                            onChange={(e) => updateCreditCard(card.id, 'expiryDate', e.target.value)}
                            placeholder="MM/YY"
                            className="bg-gray-600 border-gray-500 text-white"
                          />
                        </div>
                        <div>
                          <Label className="flex items-center justify-between">
                            CVV
                            {getStatusBadge(true, !!card.cvv)}
                          </Label>
                          <Input
                            value={card.cvv}
                            onChange={(e) => updateCreditCard(card.id, 'cvv', e.target.value)}
                            placeholder="123"
                            className="bg-gray-600 border-gray-500 text-white"
                          />
                        </div>
                      </div>

                      <div>
                        <Label className="flex items-center justify-between">
                          Cardholder Name
                          {getStatusBadge(true, !!card.cardholderName)}
                        </Label>
                        <Input
                          value={card.cardholderName}
                          onChange={(e) => updateCreditCard(card.id, 'cardholderName', e.target.value)}
                          placeholder="John Doe"
                          className="bg-gray-600 border-gray-500 text-white"
                        />
                      </div>

                      <div>
                        <Label className="flex items-center justify-between">
                          Billing Address
                          {getStatusBadge(false, true)}
                        </Label>
                        <Textarea
                          value={card.billingAddress}
                          onChange={(e) => updateCreditCard(card.id, 'billingAddress', e.target.value)}
                          placeholder="Enter billing address"
                          className="bg-gray-600 border-gray-500 text-white"
                        />
                      </div>
                    </CardContent>
                  </Card>
                ))}
              </div>
            </TabsContent>

            {/* Communication Channels Tab */}
            <TabsContent value="communicationchannels" className="p-6">
              <div className="space-y-4">
                <h2 className="text-lg font-semibold">Communication Channels</h2>

                <Card className="bg-gray-700 border-gray-600">
                  <CardHeader>
                    <CardTitle className="flex items-center gap-2">
                      <Smartphone className="w-4 h-4" />
                      Email Configuration
                    </CardTitle>
                  </CardHeader>
                  <CardContent className="space-y-4">
                    <div>
                      <Label className="flex items-center justify-between">
                        Email Provider
                        {getStatusBadge(true, false)}
                      </Label>
                      <Select>
                        <SelectTrigger className="bg-gray-600 border-gray-500 text-white">
                          <SelectValue placeholder="Select provider" />
                        </SelectTrigger>
                        <SelectContent className="bg-gray-700 border-gray-600">
                          <SelectItem value="gmail">Gmail</SelectItem>
                          <SelectItem value="outlook">Outlook</SelectItem>
                          <SelectItem value="yahoo">Yahoo</SelectItem>
                          <SelectItem value="custom">Custom IMAP/SMTP</SelectItem>
                        </SelectContent>
                      </Select>
                    </div>
                    <div>
                      <Label className="flex items-center justify-between">
                        Email Address
                        {getStatusBadge(true, false)}
                      </Label>
                      <Input
                        placeholder="your@email.com"
                        className="bg-gray-600 border-gray-500 text-white"
                      />
                    </div>
                  </CardContent>
                </Card>

                <Card className="bg-gray-700 border-gray-600">
                  <CardHeader>
                    <CardTitle className="flex items-center gap-2">
                      <MessageSquare className="w-4 h-4" />
                      SMS Configuration
                    </CardTitle>
                  </CardHeader>
                  <CardContent className="space-y-4">
                    <div>
                      <Label className="flex items-center justify-between">
                        Mobile Number
                        {getStatusBadge(false, false)}
                      </Label>
                      <Input
                        placeholder="+44 123 456 7890"
                        className="bg-gray-600 border-gray-500 text-white"
                      />
                    </div>
                  </CardContent>
                </Card>

                <Card className="bg-gray-700 border-gray-600">
                  <CardHeader>
                    <CardTitle className="flex items-center gap-2">
                      <Mic className="w-4 h-4" />
                      Voice Configuration
                    </CardTitle>
                  </CardHeader>
                  <CardContent className="space-y-4">
                    <div>
                      <Label className="flex items-center justify-between">
                        Voice Assistant
                        {getStatusBadge(false, false)}
                      </Label>
                      <Select>
                        <SelectTrigger className="bg-gray-600 border-gray-500 text-white">
                          <SelectValue placeholder="Select assistant" />
                        </SelectTrigger>
                        <SelectContent className="bg-gray-700 border-gray-600">
                          <SelectItem value="alexa">Amazon Alexa</SelectItem>
                          <SelectItem value="google">Google Assistant</SelectItem>
                          <SelectItem value="siri">Apple Siri</SelectItem>
                          <SelectItem value="cortana">Microsoft Cortana</SelectItem>
                        </SelectContent>
                      </Select>
                    </div>
                  </CardContent>
                </Card>

                <Card className="bg-gray-700 border-gray-600">
                  <CardHeader>
                    <CardTitle className="flex items-center gap-2">
                      <Lock className="w-4 h-4" />
                      Secure Messenger
                    </CardTitle>
                  </CardHeader>
                  <CardContent className="space-y-4">
                    <div>
                      <Label className="flex items-center justify-between">
                        Messenger Type
                        {getStatusBadge(false, false)}
                      </Label>
                      <Select>
                        <SelectTrigger className="bg-gray-600 border-gray-500 text-white">
                          <SelectValue placeholder="Select messenger" />
                        </SelectTrigger>
                        <SelectContent className="bg-gray-700 border-gray-600">
                          <SelectItem value="telegram">Telegram</SelectItem>
                          <SelectItem value="signal">Signal</SelectItem>
                          <SelectItem value="whatsapp">WhatsApp Business</SelectItem>
                        </SelectContent>
                      </Select>
                    </div>
                  </CardContent>
                </Card>
              </div>
            </TabsContent>

            {/* Security Tab */}
            <TabsContent value="security" className="p-6">
              <div className="space-y-4">
                <h2 className="text-lg font-semibold">Security Settings</h2>

                <Card className="bg-gray-700 border-gray-600">
                  <CardHeader>
                    <CardTitle className="flex items-center gap-2">
                      <Shield className="w-4 h-4" />
                      Authentication
                    </CardTitle>
                  </CardHeader>
                  <CardContent className="space-y-4">
                    <div>
                      <Label className="flex items-center justify-between">
                        Two-Factor Authentication
                        {getStatusBadge(false, false)}
                      </Label>
                      <Select>
                        <SelectTrigger className="bg-gray-600 border-gray-500 text-white">
                          <SelectValue placeholder="Select 2FA method" />
                        </SelectTrigger>
                        <SelectContent className="bg-gray-700 border-gray-600">
                          <SelectItem value="none">Disabled</SelectItem>
                          <SelectItem value="sms">SMS</SelectItem>
                          <SelectItem value="authenticator">Authenticator App</SelectItem>
                          <SelectItem value="hardware">Hardware Token</SelectItem>
                        </SelectContent>
                      </Select>
                    </div>
                  </CardContent>
                </Card>
              </div>
            </TabsContent>
          </Tabs>
        </div>
      </div>

      {/* Upload Documents Modal */}
      <Modal show={isUploadOpen} onClose={onUploadClose} size="2xl">
        <ModalHeader>Upload Documents</ModalHeader>
        <ModalBody>
          <div className="space-y-4">
            <div className="border-2 border-dashed border-gray-600 rounded-lg p-8 text-center">
              <Upload className="w-12 h-12 mx-auto text-gray-400 mb-4" />
              <p className="text-gray-400 mb-2">Upload or drag and drop documents</p>
              <p className="text-sm text-gray-500">Supports: PDF, JPG, PNG, TTL</p>
              <Button className="mt-4">
                <Upload className="w-4 h-4 mr-2" />
                Browse Files
              </Button>
            </div>
            <div className="space-y-2">
              <h4 className="font-medium">Supported Documents:</h4>
              <ul className="text-sm text-gray-400 space-y-1">
                <li> Driving License</li>
                <li> Passport</li>
                <li> Bank Statements</li>
                <li> Credit Card Photos</li>
                <li> Insurance Quotes</li>
                <li> Configuration Screenshots</li>
              </ul>
            </div>
          </div>
        </ModalBody>
        <ModalFooter>
          <Button color="gray" onClick={onUploadClose}>Cancel</Button>
          <Button>Upload</Button>
        </ModalFooter>
      </Modal>

      {/* Help Modal */}
      <Modal show={isHelpOpen} onClose={onHelpClose} size="2xl">
        <ModalHeader>AI Assistant - Help</ModalHeader>
        <ModalBody>
          <div className="space-y-4">
            <div className="bg-gray-700 rounded-lg p-4">
              <p className="text-sm">
                Welcome! I'm here to help you configure your settings. I can assist with:
              </p>
              <ul className="text-sm text-gray-300 mt-2 space-y-1">
                <li> Setting up bank accounts and Open Banking</li>
                <li> Adding credit cards securely</li>
                <li> Configuring communication channels</li>
                <li> Security settings and 2FA</li>
                <li> Document upload and field extraction</li>
              </ul>
            </div>
            <div className="flex gap-2">
              <Input placeholder="Ask me anything..." className="bg-gray-600 border-gray-500 text-white" />
              <Button>Send</Button>
            </div>
          </div>
        </ModalBody>
      </Modal>
    </div>
  );
}

export default App;
